('2355','18','7882','Villa Drac',Null,'Moderne Villa in 1. Meereslinie in Porto Colom','33174','Diese moderne Villa wurde 2008 auf einem ca 850m² großen Grundstück in 1. Meereslinie in Porto Colom gebaut. Die Licht durchflutete helle Villa hat ca 480m² Wohnfläche und bietet 7 Schlafzimmer mit 7 Badezimmer. Zur Ausstattung gehören Panorama Doppelglasfenster, Fußbodenheizung, Klimaanlage w/k, moderne Einbauküche u.v.m. Im Außenbereich hat es noch einen beheizbaren Pool mit Liegeterrassen. Die Tiefgarage bietet Platz für 3 Autos. \r\n\r\n','33175','2600000','106','2015-07-31 11:41:02','106','2015-07-31 11:42:32',Null,'2434','109','1123',1,'1','0',Null,Null,Null,'33176',Null,'0','0','0',Null,'2015-07-31 11:47:35',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33177',Null,'33178',Null,'33179',Null,'33180','971 783242   630 886 877','33181','0',0,'4');
